import React from 'react'
import { useState,useEffect } from 'react'
import axios from 'axios'
function HomeScreen() {

  useEffect(async()=>{
    
    try{
       const data=(await axios.get('/api/rooms/getallrooms')).data;
       console.log(data);
    }
    catch(error){
       console.log(error);
    }
},[])


  return (
    <>
      <h1>Hello World</h1>
    </>
  )
}

export default HomeScreen
